import React, { Component } from 'react';
import './MovementBank.css'


class Movement extends Component {


    render() {
        const  { name } = this.props
        return (
            <>
            <div class="container">
                <div class="card">
                    <div class="front">{name}</div>
                    <div class="back">Yo, what up?</div>
                </div>
            </div>
            </>
        );
    }
}

export default Movement;
